import React, { useState } from "react";
import styles from "./Gallery.module.css";

const imageUrls = [
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQe9ZsiGOkdaK9_v4RTm06FyX7mwAFDw2ViVg&s",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSoHdv_WgaGl9iBLVl78LQK1pPbIHnHkn2RvA&s",
  "https://images.unsplash.com/photo-1503676260728-1c00da094a0b?auto=format&fit=crop&w=800&q=80",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQzgjTfpWcZ65Jeip8hIzI6fdzKussHeUVzTw&s",
  "https://images.unsplash.com/photo-1573164713988-8665fc963095?auto=format&fit=crop&w=800&q=80",
  "https://images.unsplash.com/photo-1512290923902-8a9f81dc236c?auto=format&fit=crop&w=800&q=80",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR_Lp2JJcpusIy4te4FHE9RqlWnDlzlxBcVzQ&s",
  "data:image/jpeg;base64,",
  "data:image/jpeg;base64,",
  "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSnI6PODloUitR9eBALSUX4ldf-HWrnVHqFXQ&s",
];


function Gallery() {
  const [selectedImage, setSelectedImage] = useState(null);

  const handleImageClick = (imageUrl) => {
    setSelectedImage(imageUrl);
  };

  return (
    <div className={styles.gallery}>
      <h2>Image Gallery</h2>
      <div className={styles.imageGrid}>
        {imageUrls.map((imageUrl, index) => (
          <div
            key={index}
            className={styles.imageContainer}
            onClick={() => handleImageClick(imageUrl)}
          >
            <img src={imageUrl} alt={`Image ${index + 1}`} />
          </div>
        ))}
      </div>
      {selectedImage && (
        <div className={styles.modal}>
          <span className={styles.close} onClick={() => setSelectedImage(null)}>
            &times;
          </span>

          <img
            src={selectedImage}
            alt="Selected Image"
            className={styles.modalImage}
          />
        </div>
      )}
    </div>
  );
}

export default Gallery;
